// Components/Expediente/Expedientes.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Expedientes.css';
import pageLogo from '../assets/logo.png';
import viewIcon from '../assets/ojo.png';
import deleteIcon from '../assets/basura.png';
import logoutIcon from '../assets/cerrar.png';

const Expedientes = () => {
    const navigate = useNavigate();

    const goToUserManagement = () => {
        navigate('/users');
    };

    const goToDocumentos = () => {
        navigate('/documentos');
    };

    return (
        <div className="main-container">
            <nav className="navbar">
                <div className="logo">
                    <img src={pageLogo} alt="Page Logo" />
                    Expedium
                </div>
                <ul className="nav-links">
                    <li onClick={goToUserManagement}>Usuarios</li>
                    <li>Expedientes</li>
                    <li onClick={goToDocumentos}>Documentos</li>
                    <li>Perfil</li>
                </ul>
                <div className="logout-icon">
                    <img src={logoutIcon} alt="Logout" />
                </div>
            </nav>
            <div className="user-table">
                    <table>
                        <thead>
                            <tr>
                                <th>TÃ­tulo del documento</th>
                                <th>Tipo de archivo</th>
                                <th>Acciones</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Proyecto final</td>
                                <td>PDF</td>
                                <td className="actions">
                                    <button className="action-btn">
                                        <img src={viewIcon} alt="Ver" />
                                    </button>
                                    <button className="action-btn">
                                        <img src={deleteIcon} alt="Eliminar" />
                                    </button>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
        </div>
    );
}

export default Expedientes;
